import React from 'react'
import styled from 'styled-components'

const Section = styled.section`
min-height: 100vh;
width: 100%;
background-color: ${props => props.theme.lightBody};
display: flex;
justify-content: center;
align-items: center;
position: relative;
`
const Container = styled.div`
width: 75%;
min-height: 80vh;
margin: 0 auto;

display: flex;
justify-content: center;
align-items: center;
`

const Box = styled.div`
width: 50%;
height: 100%;
max-height: 75vh;
display: flex-start;
flex-direction: coloumn;
justify-content: center;
align-items: center;
position: relative;
`

const Details = () => {
  return (
    <Section>
      Details
    </Section>
  )
}

export default Details
